using System.Diagnostics;
using System.Text.Json;
using System.Text.Json.Nodes;
using chart2csv.Parser;
using chart2csv.Parser.States;
using chart2csv.Parser.Steps;

ParserState DeserializeState(JsonElement input)
{
    var type = input.GetProperty("type").GetString();
    return type switch
    {
        "InitialState" => input.GetProperty("data").Deserialize<InitialState>() ??
                          throw new Exception("Invalid json state"),
        _ => throw new Exception($"Unknown json state \"{type}\"")
    };
}

JsonNode? ProcessState(ParserState input, string step)
{
    return step switch
    {
        "FindOriginStep" => JsonSerializer.SerializeToNode(new FindOriginStep().Process((InitialState)input)),
        _ => throw new Exception($"Unknown step \"{step}\"")
    };
}

var rawCommand = Console.ReadLine();
// var rawCommand = @"{
//   ""input"": {
//     ""type"": ""InitialState"",
//     ""data"": {
//       ""InputImage"": """"
//     }
//   },
//   ""step"": ""FindOriginStep""
// }";
var command = JsonDocument.Parse(rawCommand);

var rawInput = command.RootElement.GetProperty("input");
var inputState = DeserializeState(rawInput);
var step = command.RootElement.GetProperty("step").GetString();
var outputState = ProcessState(inputState, step!);

var outputDocument = new JsonObject { { "output", outputState } };

Console.WriteLine(JsonSerializer.Serialize(outputDocument));
